  return (
    <>
      <Navbar />
      <div className="aboutContainer">
        <div className="aboutHistoryContainer">
          <h3 className="aboutHistoryTitle">OUR HISTORY</h3>
          <p className="aboutHistory"></p>
        </div>
      </div>
      <Footer />
    </>
  );
};

export default About;
